mapper.select:

select 

from amz_fba_shipment_reports


     and id = #{id,jdbcType=BIGINT}


     and seller = #{seller,jdbcType=VARCHAR}


     and shipment_date = #{shipmentDate,jdbcType=TIMESTAMP}


     and shipment_utc_date = #{shipmentUtcDate,jdbcType=VARCHAR}


     and sku = #{sku,jdbcType=VARCHAR}


     and fnsku = #{fnsku,jdbcType=VARCHAR}


     and asin = #{asin,jdbcType=VARCHAR}


     and fulfillment_center_id = #{fulfillmentCenterId,jdbcType=VARCHAR}


     and quantity = #{quantity,jdbcType=INTEGER}


     and amazon_order_id = #{amazonOrderId,jdbcType=VARCHAR}


     and seller_order_id = #{sellerOrderId,jdbcType=VARCHAR}


     and currency = #{currency,jdbcType=VARCHAR}


     and item_price_per_unit = #{itemPricePerUnit,jdbcType=REAL}


     and shipping_price = #{shippingPrice,jdbcType=REAL}


     and gift_wrap_price = #{giftWrapPrice,jdbcType=REAL}


     and ship_city = #{shipCity,jdbcType=VARCHAR}


     and ship_state = #{shipState,jdbcType=VARCHAR}


     and ship_postal_code = #{shipPostalCode,jdbcType=VARCHAR}


     and report_id = #{reportId,jdbcType=VARCHAR}


     and marketplaces = #{marketplaces,jdbcType=VARCHAR}


     and create_time = #{createTime,jdbcType=TIMESTAMP}


     and update_time = #{updateTime,jdbcType=TIMESTAMP}


     and transfer_number = #{transferNumber,jdbcType=VARCHAR}


     and outbound = #{outbound,jdbcType=VARCHAR}


     and check_status = #{checkStatus,jdbcType=TINYINT}


     and amz_sku = #{amzSku,jdbcType=VARCHAR}


     and msku_matched = #{mskuMatched,jdbcType=BIT}


limit 1


